import { Box, Container } from "@mui/material"
import styles from 'utilities/global_styles.module.css'

const TopBar = () => {
    return (
        <Container maxWidth="lg" style={{ height: "72px" }} sx={{ marginTop: 2, alignItems: "center", display: "flex" }}>
            <img src="img/app_logo.svg" />
            <Box className={styles.headerTitle} sx={{ marginLeft: 1 }}>Civitas Europe</Box>
        </Container>
    );
}

export default TopBar
